import React from 'react';
import Navbar from './components/Navbar';
import './App.css';

import { HomeIcon } from '@material-ui/icons/Home';
import { SearchIcon } from '@material-ui/icons/Search';

function App() {
  return (
    <BrowserRouter>
      <Navbar />
      <Route exact path="/">
        <HomeIcon /> 
      </Route>
      <Route path="/signin">
        <SearchIcon /> 
      </Route>
      <Route path="/signup">
        <Signup />
      </Route>
      <Route path="/profile">
        <Profile />
      </Route>
    </BrowserRouter>
  );
}

export default App;
